import React from 'react'
import '../css/detail.css';
import styled from 'styled-components';

const InputForm = styled.div`
    position: relative;
    padding: 0px;
    gap: 9.7px;
    width: 30%;
`
const LabelLine = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    padding: 0px;
    gap: 4.85px;
    height: 24px;
`;

const Label = styled.label`
    font-family: 'Mulish';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 20px;
`;

function Compare() {
  return (
    <div className="compare-form">
        <InputForm>
            <LabelLine>
                <Label>Nhập tên sản phẩm</Label>
            </LabelLine>
        </InputForm>
    </div>
    
  )
}

export default Compare
